const Room = {
    SWIMMING_POOL: 'SWIMMING_POOL',
    BASKETBALL_HALL: 'BASKETBALL_HALL',
    BIG_ROOM: 'BIG_ROOM',
    SMALL_ROOM: 'SMALL_ROOM'
};

const TypeOfEvent = {
    PARTY: 'PARTY',
    CONCERT: 'CONCERT',
    SPORTS_MATCH: 'SPORTS_MATCH',
    SPORTS_TRAINING: 'SPORTS_TRAINING',
